import React from 'react';
import logo from './logo.svg';
import './App.css';

const App = function() {
  return ( 
    <div className="App"> 

      <header className="header">
        <img src="localhost:3000/mi-app/src/imagelogo.png"
                  alt="Картинка" width="50" />
        Header
      </header>

      <nav className="nav">
        <a>Profile</a>
        <a>Messages</a>
        <a>Music</a>
        <a>Settings</a>
        HiperNav
      </nav>

      <main className="main">
        Main content
      </main>

    </div> 
  );
}

export default App;
